  inline double pow(double x, int exp) {
    if(exp == 0) return 1.0;
    else if(exp == 1) return x;
    else if(exp < 0) return 1.0/pow(x, -exp);
    else {
      int tmpExp = exp >> 1;
      double xx = x;
      double rlt = exp & 0x1 ? x : 1.0;
      do {
        xx *= xx;
        if(tmpExp & 0x1) {
          rlt *= xx;
        }
      } while (tmpExp >>= 1);
      return rlt;
    }
  }

